 ('N.T.M. CDR SBC',308,'IF OCTECTS_F_IN > 1000 AND OCTECTS_F_IN < 1000000 THEN\r\n'),
 ('N.T.M. CDR SBC',308,'  RESULT = ROUND( OCTECTS_F_IN/1000, 0 ) & \"K\"\r\n'),
 ('N.T.M. CDR SBC',308,'ELSE IF OCTECTS_F_IN >= 1000000 THEN\r\n'),
 ('N.T.M. CDR SBC',308,'  RESULT = ROUND(OCTECTS_F_IN/1000000, 0) & \"M\"\r\n'),
 ('N.T.M. CDR SBC',308,'ELSE\r\n'),
 ('N.T.M. CDR SBC',308,'  RESULT = ROUND(OCTECTS_F_IN, 0)\r\n'),
 ('N.T.M. CDR SBC',308,'ENDIF\r\n'),
 ('N.T.M. CDR SBC',308,'IF PIVOT_RUNNING = 1 THEN\r\n'),
 ('N.T.M. CDR SBC',308,'  RESULT = ROUND( OCTECTS_F_IN/1000, 0 )\r\n'),
 ('N.T.M. CDR SBC',308,'ENDIF\r\n'),
 ('N.T.M.-Voce-20060523',347,'IF INSTR(tRELATION_STR, \"::te\") <> undef OR INSTR(tRELATION_STR, \"::tu\") <>\r\nundef THEN\r\n RESULT=\"Total Circuits:\"&tNUM_ROWS\r\nELSE\r\n RESULT=\"Total:\"\r\nENDIF'),
 ('N.T.M.-MK-NV',347,'IF INSTR(tRELATION_STR, \"::te\") <> undef OR INSTR(tRELATION_STR, \"::tu\") <>\r\nundef THEN\r\n RESULT=\"Total Circuits:\"&tNUM_ROWS\r\nELSE\r\n RESULT=\"Total:\"\r\nENDIF'),
 ('N.T.M. CDR SBC',307,'IF OCTECTS_R_IN > 1000 AND OCTECTS_R_IN < 1000000 THEN\r\n'),
 ('N.T.M. CDR SBC',307,'  RESULT = ROUND( OCTECTS_R_IN/1000, 0 ) & \"K\"\r\n'),
 ('N.T.M. CDR SBC',307,'ELSE IF OCTECTS_R_IN >= 1000000 THEN\r\n'),
 ('N.T.M. CDR SBC',307,'  RESULT = ROUND(OCTECTS_R_IN/1000000, 0) & \"M\"\r\n'),
 ('N.T.M. CDR SBC',307,'ELSE\r\n'),
 ('N.T.M. CDR SBC',307,'  RESULT = ROUND(OCTECTS_R_IN, 0)\r\n'),
 ('N.T.M. CDR SBC',307,'ENDIF\r\n'),
 ('N.T.M. CDR SBC',307,'IF PIVOT_RUNNING = 1 THEN\r\n'),
 ('N.T.M. CDR SBC',307,'  RESULT = ROUND( OCTECTS_R_IN/1000, 0 )\r\n'),
 ('N.T.M. CDR SBC',307,'ENDIF\r\n'),
 ('INDEX_DATA_VOICE',74,'IF INSTR(tRELATION_STR, \"::te\") <> undef OR INSTR(tRELATION_STR, \"::tu\") <> \r\nundef  THEN\r\n  RESULT=\"Total Circuits: \"&tNUM_ROWS\r\nELSE\r\n  RESULT=\"Total:\"\r\nENDIF'),
 ('INDEX_DATA_VOICE',74,'\r\n');
